description:
This collection of Warren G albums includes Regulate...G Funk Era (1994), Take A Look Over Your Shoulder (1997), I Want It All (1999), The Return Of The Regulator (2001), and In the Mid-Nite Hour (2005).

This is a complete discography of Warren G, with the exception of a UK album entitled &quot;Smokin' Me Out&quot; from 1997.  I couldn't get my hands on that CD, so you'll have to do without. 
